import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div>
        And now I exist
        <div>
          <div className="main_navbar">
            <p>Navbar</p>
          </div>
          <div className="main_body">
            <p>Main Body</p>
          </div>
          <div className="main_footer">
            <p>Footer</p>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
